CREATE TABLE `trs_tbl_assets` (
  `asset_id` bigint NOT NULL AUTO_INCREMENT,
  `fleet_id` bigint NOT NULL,
  `carrier_id` bigint DEFAULT NULL,
  `asset_number_id` varchar(25) NOT NULL,
  `asset_type_id` bigint NOT NULL,
  `year` int NOT NULL,
  `asset_make_id` bigint NOT NULL,
  `model` varchar(255) NOT NULL,
  `plate` varchar(10) NOT NULL,
  `state_id` bigint NOT NULL,
  `vin_number` varchar(50) NOT NULL,
  `country_id` bigint NOT NULL,
  `registered_weight` int NOT NULL,
  `units` tinyint(1) NOT NULL COMMENT '1-->kgs 2-->lbs',
  `number_of_axels` tinyint NOT NULL,
  `start_date` date NOT NULL,
  `inactive_date` date DEFAULT NULL,
  `comments` varchar(255) DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0',
  `created_by` bigint NOT NULL,
  `created_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modified_by` bigint NOT NULL,
  `modified_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`asset_id`),
  KEY `asset_type_id_assets_constraint` (`asset_type_id`),
  KEY `asset_make_id_asset_constraint` (`asset_make_id`),
  KEY `asset_country_id_constraint` (`country_id`),
  KEY `fleet_asset_id_constraint` (`fleet_id`),
  KEY `asset_carrier_id_constraint` (`carrier_id`),
  KEY `asset_plate_state_id_constraint` (`state_id`),
  CONSTRAINT `asset_carrier_id_constraint` FOREIGN KEY (`carrier_id`) REFERENCES `trs_tbl_carriers` (`carrier_id`),
  CONSTRAINT `asset_country_id_constraint` FOREIGN KEY (`country_id`) REFERENCES `trs_tbl_countries` (`country_id`),
  CONSTRAINT `asset_make_id_asset_constraint` FOREIGN KEY (`asset_make_id`) REFERENCES `trs_tbl_asset_make` (`asset_make_id`),
  CONSTRAINT `asset_plate_state_id_constraint` FOREIGN KEY (`state_id`) REFERENCES `trs_tbl_states` (`state_id`),
  CONSTRAINT `asset_type_id_assets_constraint` FOREIGN KEY (`asset_type_id`) REFERENCES `trs_tbl_asset_type` (`asset_type_id`),
  CONSTRAINT `fleet_asset_id_constraint` FOREIGN KEY (`fleet_id`) REFERENCES `trs_tbl_fleets` (`fleet_id`)
) ENGINE=InnoDB AUTO_INCREMENT=334 DEFAULT CHARSET=latin1;
