DROP TABLE IF EXISTS `trs_tbl_carriers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `trs_tbl_carriers` (
  `carrier_id` bigint NOT NULL AUTO_INCREMENT,
  `carrier_name` varchar(255) NOT NULL,
  `company_name` text NOT NULL,
  `carrier_stripe_name` varchar(100) DEFAULT NULL,
  `carrier_email` varchar(200) NOT NULL,
  `carrier_address` text NOT NULL,
  `carrier_phone` varchar(15) NOT NULL,
  `zip` varchar(10) NOT NULL,
  `package_id` bigint NOT NULL,
  `request_from` tinyint(1) NOT NULL DEFAULT '0',
  `conversion_token` varchar(200) DEFAULT NULL,
  `invoice_number` varchar(50) NOT NULL,
  `stripe_subscription_id` varchar(100) NOT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `subscription_end_date` date DEFAULT NULL,
  `terms_and_conditions_acceptance_date` datetime DEFAULT NULL,
  `city` varchar(50) NOT NULL,
  `state_id` bigint NOT NULL,
  `country_id` bigint NOT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `created_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`carrier_id`),
  KEY `carrier_state_id_constraint` (`state_id`),
  KEY `carrier_country_id_constraint` (`country_id`),
  KEY `package_carrier_id_constraint` (`package_id`),
  CONSTRAINT `carrier_country_id_constraint` FOREIGN KEY (`country_id`) REFERENCES `trs_tbl_countries` (`country_id`),
  CONSTRAINT `carrier_state_id_constraint` FOREIGN KEY (`state_id`) REFERENCES `trs_tbl_states` (`state_id`),
  CONSTRAINT `package_carrier_id_constraint` FOREIGN KEY (`package_id`) REFERENCES `trs_tbl_packages` (`package_id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

